import React, {Component} from 'react';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import './tabs.css'

export default function TabAndPanel(props) {
  console.log('PROPS IN TAB COMP:', props)
  const assetList = props.assets
  assetList.map(i=>console.log(i))

  return (
    <div>
      <Tabs>
        <TabList className='tabItem-container'>
          {assetList.map( i=> <Tab className='tabItem'> {i.assetNumber} </Tab> )} 
        </TabList>
          {assetList.map( i=> <TabPanel className='tab-panel'> {i.key} </TabPanel> )}
      </Tabs>
    </div>
    )

}
